import React, { useState } from "react";
import axios from "axios";

const SearchForm = () => {
  // State for homes filters
  const [city, setCity] = useState("");
  const [zip, setZip] = useState("");
  const [county, setCounty] = useState("");

  // State for rooms filters
  const [availability, setAvailability] = useState("");
  const [roomType, setRoomType] = useState("");
  const [dateAvailable, setDateAvailable] = useState("");

  // State to hold the search results
  const [searchResults, setSearchResults] = useState({ homes: [], rooms: [] });

  // Function to handle form submission using axios
  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      // Form the URL for the Directus API endpoint for "homes"
      const homesURL = `https://api.secondhomeseniors.com/directus/items/homes?filter[city][like]=${city}&filter[zip][like]=${zip}&filter[county][like]=${county}`;

      // Fetch data from Directus for "homes" collection using axios
      const homesResponse = await axios.get(homesURL);
      const homesData = homesResponse.data.data;

      // Form the URL for the Directus API endpoint for "rooms"
      const roomsURL = `https://api.secondhomeseniors.com/directus/items/rooms?filter[availability][like]=${availability}&filter[roomtype][like]=${roomType}&filter[date_available][like]=${dateAvailable}`;

      // Fetch data from Directus for "rooms" collection using axios
      const roomsResponse = await axios.get(roomsURL);
      const roomsData = roomsResponse.data.data;

      // Combine and set the search results for both "homes" and "rooms"
      setSearchResults({ homes: homesData, rooms: roomsData });
    } catch (error) {
      console.error("Error fetching data:", error);
    }
  };

  return (
    <div>
      <form onSubmit={handleSubmit}>
        {/* Add input fields, dropdowns, etc., for both homes and rooms filters */}
        {/* For example: */}
        <input
          type="text"
          value={city}
          onChange={(e) => setCity(e.target.value)}
          placeholder="City"
        />
        <input
          type="text"
          value={zip}
          onChange={(e) => setZip(e.target.value)}
          placeholder="ZIP"
        />
        <input
          type="text"
          value={county}
          onChange={(e) => setCounty(e.target.value)}
          placeholder="County"
        />
        {/* ... add more input fields for other home filters */}
        <input
          type="text"
          value={availability}
          onChange={(e) => setAvailability(e.target.value)}
          placeholder="Availability"
        />
        <input
          type="text"
          value={roomType}
          onChange={(e) => setRoomType(e.target.value)}
          placeholder="Room Type"
        />
        <input
          type="text"
          value={dateAvailable}
          onChange={(e) => setDateAvailable(e.target.value)}
          placeholder="Date Available"
        />
        {/* ... add more input fields for other room filters */}
        <button type="submit">Search</button>
      </form>

      {/* Display the search results */}
      {searchResults.homes.length > 0 && (
        <div>
          <h2>Homes:</h2>
          <ul>
            {searchResults.homes.map((home) => (
              <li key={home.id}>
                {/* Display relevant data for each home */}
                <p>City: {home.city}</p>
                <p>Zip: {home.zip}</p>
                {/* Add other home properties */}
              </li>
            ))}
          </ul>
        </div>
      )}

      {searchResults.rooms.length > 0 && (
        <div>
          <h2>Rooms:</h2>
          <ul>
            {searchResults.rooms.map((room) => (
              <li key={room.id}>
                {/* Display relevant data for each room */}
                <p>Availability: {room.availability}</p>
                <p>Room Type: {room.roomtype}</p>
                {/* Add other room properties */}
              </li>
            ))}
          </ul>
        </div>
      )}
    </div>
  );
};

export default SearchForm;
